import styled from 'styled-components';
import {useEffect} from 'react'
import axios from 'axios'

const Apis = () => {
  useEffect(() => {
    axios.get('https://prod.wantedb.shop/submissions').then(res => console.log(res.data))
  })
  return (
    <Page>
      <ItemBox>

      </ItemBox>
    </Page>
  )
}

export default Apis;

const Page = styled.div`
  width: 100%;
  height: 1000px;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
`
const ItemBox = styled.div`
  width: 60%;
  height: 90%;
  background: gray;
  padding-left: 30px;
`
const Items = styled.div`
  text-align: left;
`
